```

This script utilizes Prodigal version 2.6.3 to perform gene prediction and runs within the TACC launcher framework. It utilizes Singularity for containerization and leverages SLURM for resource management. The script is configured to run on a single node with a single core, in the 'normal' queue, for a maximum of 24 hours. It uses the 'iPlant-Collabs' account for resource allocation.
